{% extends '@PrestaShop/Admin/layout.html.twig' %}

{% trans_default_domain 'Admin.Advparameters.Feature' %}

{% block content %}
  {% block backup_download_file %}
    {% if hasDownloadFile %}
      {% include '@PrestaShop/Admin/Configure/AdvancedParameters/Backup/Blocks/download_file.html.twig' %}
    {% endif %}
  {% endblock %}

  {% block backup_alerts %}
    {% if multistoreIsUsed %}{{ ps.infotip(multistoreInfoTip, true) }}{% endif %}
    <div class=\"row\">
      <div class=\"col\">
        {% include '@PrestaShop/Admin/Configure/AdvancedParameters/Backup/Blocks/backup_warning.html.twig' %}
      </div>
    </div>

    <div class=\"row\">
      <div class=\"col\">
        {% include '@PrestaShop/Admin/Configure/AdvancedParameters/Backup/Blocks/backup_info.html.twig' %}
      </div>
    </div>
  {% endblock %}

  {% block backup_listing %}
    <div class=\"row\">
      <div class=\"col\">
        {% include '@PrestaShop/Admin/Common/Grid/grid_panel.html.twig' with {'grid': backupGrid} %}
      </div>
    </div>
  {% endblock %}

  {% block backup_options %}
    <div class=\"row\">
      <div class=\"col\">
        {% include '@PrestaShop/Admin/Configure/AdvancedParameters/Backup/Blocks/options.html.twig' %}
      </div>
    </div>
  {% endblock %}
{% endblock %}

{% block javascripts %}
    {{ parent() }}

  <script src=\"{{ asset('themes/default/js/bundle/pagination.js') }}\"></script>
  <script src=\"{{ asset('themes/new-theme/public/backup.bundle.js') }}\"></script>
{% endblock %}
", "@PrestaShop/Admin/Configure/AdvancedParameters/Backup/index.html.twig", "/var/www/html/src/PrestaShopBundle/Resources/views/Admin/Configure/AdvancedParameters/Backup/index.html.twig");
    }
